var languages = ["Swift", "OC", "PHP", "Perl" , "Ruby" , "Go"]// 删除索引为2的元素，删除"PHP"languages.removeAtIndex(2)// 再次删除索引为2的元素，删除"Perl"languages.removeAtIndex(2)println(languages)  // 输出[Swift, OC, Ruby, Go]// 删除最后一个元素，删除"Go"languages.removeLast()println(languages)  // 输出[Swift, OC, Ruby]// 删除所有元素languages.removeAll()println(languages)  // 输出[]println(languages.count)  // 输出0